import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import VideoSegmentApp from '../components/video-segment';
import { samplePayload } from '../components/video-segment/payload';
import { AnnotationType } from '../types';

const VideoSegmentComp: React.FC = withConnect({ type: AnnotationType.VIDEO_SEGMENT, methods: { onSubmit: 'exportResult', cleanData: 'cleanData' }, samplePayload })(VideoSegmentApp);

ReactDOM.render(
  <VideoSegmentComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
